trg_val_calc:
IF
(diagnstatus==”Diagnosed with ADPKD”){age - difftime(dmdat, diagndate, units = "years")}
ELSE {NA}

IF
(fm1rel==”Mother” & fm1diagn ==”Yes”){“Yes”}
ELSE IF
(fm1rel==”Mother” & fm1diagn ==”No”){“No”}
ELSE IF
(fm2rel==”Mother” & fm2diagn ==”Yes”){“Yes”}
ELSE IF
(fm2rel==”Mother” & fm2diagn ==”No”){“No”}
ELSE IF
(fm3rel==”Mother” & fm3diagn ==”Yes”){“Yes”}
ELSE IF
(fm3rel==”Mother” & fm3diagn ==”No”){“No”}
ELSE IF
(fm4rel==”Mother” & fm4diagn ==”Yes”){“Yes”}
ELSE IF
(fm4rel==”Mother” & fm4diagn ==”No”){“No”}
ELSE {NA}

IF
(fm1rel==”Father” & fm1diagn ==”Yes”){“Yes”}
ELSE IF
(fm1rel==”Father” & fm1diagn ==”No”){“No”}
ELSE IF
(fm2rel==”Father” & fm2diagn ==”Yes”){“Yes”}
ELSE IF
(fm2rel==”Father” & fm2diagn ==”No”){“No”}
ELSE IF
(fm3rel==”Father” & fm3diagn ==”Yes”){“Yes”}
ELSE IF
(fm3rel==”Father” & fm3diagn ==”No”){“No”}
ELSE IF
(fm4rel==”Father” & fm4diagn ==”Yes”){“Yes”}
ELSE IF
(fm4rel==”Father” & fm4diagn ==”No”){“No”}
ELSE {NA}

IF
(c5a == "kg"){cr5b*1000}
ELSE IF
(c5a == "lb"){cr5b*453.6}
ELSE IF
(c5a == "oz"){cr5b*28.3}
ELSE IF
(c5a == "Birth Weight Unknown"){NA}
ELSE {NA}

IF
(cr66=="Yes, Tea" | cr66=="Yes, Both"){"yes"}
ELSE IF
(cr66=="Yes, Coffee" | cr66=="No, (both)"){"no"}
ELSE {NA}

IF
(cr66=="Yes, Coffee" | cr66=="Yes, Both"){"yes"}
ELSE IF
(cr66=="Yes, Tea" | cr66=="No, (both)"){"no"}
ELSE {NA}

IF
(hb3==”Yes”){difftime(crrdate, cr4, units = "years") – hb2a}
ELSE IF
(hb3==”No”){hb5a-hb2a}
ELSE {NA}

IF
(sualcoenage = “”){age – sualcostage}
ELSE IF
(sualcoenage >0){ sualcoenage – sualcostage}
ELSE {NA}

IF
(hb30==”Yes”){difftime(crrdate, cr4, units = "years") – hb29a}
ELSE IF
(hb30==”No”){hb31a-hb29a}
ELSE {NA}
